import React from "react";

import { Container, ProductInfo } from "./styles";

function ProductCard(props) {
  return (
    <Container>
      <img src={props.imgsrc} />
      <ProductInfo>
        <h3>{props.price}</h3>
        <p>{props.title}</p>
        <sub>
          <b>{props.brand}</b>
        </sub>
      </ProductInfo>
    </Container>
  );
}

export default ProductCard;
